INSERT INTO `achievement_locale` (`ID`, `locale`, `Description_lang`, `Title_lang`, `Reward_lang`, `VerifiedBuild`) VALUES
(42230, 'ruRU', 'Счетчик оставшихся задач в первом задании середины сезона', '11.1.5, середина сезона  – итог за неделю – совместная игра – сезонный рейд, отслеживание (первый раз)', '', 60822),
(42148, 'ruRU', 'Получите все указанные достижения во время 2-го сезона The War Within.', 'Предприимчивый покоритель подземелий', 'Звание: универсальный умелец', 60822),
(42144, 'ruRU', 'В роли бойца пройдите все сезонные подземелья с эпохальным ключом 10-го уровня (или более высокого) за отведенный срок во время 2-го сезона The War Within.', 'Предприимчивый боец', '', 60822),
(42141, 'ruRU', 'В роли лекаря пройдите все сезонные подземелья с эпохальным ключом 10-го уровня (или более высокого) за отведенный срок во время 2-го сезона The War Within.', 'Предприимчивый лекарь', '', 60822),
(42139, 'ruRU', 'В роли танка пройдите все сезонные подземелья с эпохальным ключом 10-го уровня (или более высокого) за отведенный срок во время 2-го сезона The War Within.', 'Предприимчивый танк', '', 60822),
(41757, 'ruRU', 'Quest counter remaining for mid-season 11.1.5', '11.1.5 Mid-Season - Weekly Wrapper - Group Content - Seasonal Raid (YGR)', '', 60822),
(17733, 'ruRU', '', '<Hidden> 00.x Chromie Time - Is Greater Than Previous Max Level While In Chromie Time', '', 60822),
(17732, 'ruRU', '', '<Hidden> 00.x Chromie Time - Hit Previous Max Level While In Chromie Time', '', 60822),
(14855, 'ruRU', '', '<Hidden> - NPE Restrictions Removed', '', 60822),
(14807, 'ruRU', 'Once earned, a player\'s alt can access the Shadowlands Time Skip mode. (DNT)', '<Hidden> Completed Shadowlands Story (DNT) <Account>', '', 60822),
(14804, 'ruRU', 'Пройдите вступительные задания на острове Изгнанников, получив приглашение по программе \"Пригласи друга!\".', '<Hidden> Exile\'s Reach RAF Bag', '', 60822),
(14287, 'ruRU', 'Получивший это достижение игрок более не считается \"новым\", и созданные им персонажи могут начинать как на мысе Изгнанников, так и в обычной начальной зоне своей расы.', '<Скрытое> Пройден курс нового игрока (учетная запись)', '', 60822),
(14223, 'ruRU', '', '<Hidden> - NPE - Bought Item', '', 60822),
(14221, 'ruRU', '', '<Hidden> - NPE - Sold Item', '', 60822),
