INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(285883, 'ruRU', '<Вы читаете:\n\n\"Отважные жители и гости Дорногала! Нам требуется помощь в сокровищнице. Задач немало, и все они срочные. Скажем сразу: справится с ними не каждый, но награда будет щедрой и прямиком из самой сокровищницы\".\n\nНиже приведено несколько заданий.>', '<Вы читаете:\n\n\"Отважные жители и гости Дорногала! Нам требуется помощь в сокровищнице. Задач немало, и все они срочные. Скажем сразу: справится с ними не каждый, но награда будет щедрой и прямиком из самой сокровищницы\".\n\nНиже приведено несколько заданий.>', 60822),
