INSERT INTO `mount_locale` (`ID`, `locale`, `Name_lang`, `SourceText_lang`, `Description_lang`, `VerifiedBuild`) VALUES
(2278, 'ruRU', 'Пламендо Неистовый', '', 'Для самых почетных гостей Галаджио не скупится, снабжая их даже ключами от бывшего короля котла смерти. Благодаря новейшим гоблинским технологиям он расходует всего литр топлива на каждые 100 метров!', 60822),
(2528, 'ruRU', 'Магматическая химера недр', '|cFFFFD200Торговая лавка|r', 'Под надзором повелителей стихий элементали превратили химер в верных ездовых животных и спутников.', 60822),
(2527, 'ruRU', 'Раскаленная химера недр', '|cFFFFD200Торговая лавка|r|n', 'На заре истории Азерота эти стихийные хищники царили в пламенных небесах владений Рагнароса.', 60822),
